import React, {useState} from 'react';
function Cont1(props) {
  let[contor,setContor]=useState(0);
  let chnge=()=>{
    setContor(contor + props.incrmentby)
  }
  const btnstyle={
    backgroundColor: props.buttonColor,
    borderRadius:"10px",
    padding:'10px'
  }
  return (
    <div className='App'>
      <button onClick={chnge}>+{props.incrmentby}</button>
      <div>{contor}</div>
    </div>
  )
}
export default Cont1
